BEGIN
	DECLARE flag BOOLEAN DEFAULT FALSE;
	DECLARE userID INT;
	select true into flag from usertable where usertable.username = username;
	IF flag = TRUE THEN
		set `output` = 'US';
	ELSE
		START TRANSACTION;
			insert into usertable (username,`password`,`email`) values (username, `password`,`email`);
			SELECT LAST_INSERT_ID() INTO userID;
			call add_key_unique_masterkey(`key`, userID,output);
			SELECT output;
			IF output = 'ma' THEN
				ROLLBACK;
			END IF;
		COMMIT;	
	END IF;
END ;;
