CREATE DEFINER=`root`@`localhost` PROCEDURE `RetrieveKeys_UsingMasterKey`(in `user` varchar(50), in `master_key` varchar(20), out `email` varchar(255))
BEGIN
	DECLARE uname VARCHAR(50);
	DECLARE uid INT;
	
	SELECT usertable.username, usertable.id , usertable.email  into uname, uid, email
	FROM usertable
	INNER JOIN usermasterKeyMapping UM ON 1=1
		AND	`usertable`.`id` = UM.user_id
	INNER JOIN masterkeys MK ON 1=1
		AND UM.masterkey_id = MK.id
	WHERE 1=1
		AND MK.Master_Key = `master_key`;

	IF uname = `user` THEN
		SELECT `keys` 
		FROM userkeys uk 
		INNER JOIN userkeymapping ukm ON 1=1
			AND uk.id = ukm.keyid
		WHERE 1=1
			AND ukm.userid = 1;
	ELSE 
		set `email` = 'NA';
	END IF;
END ;;
