CREATE DEFINER=`root`@`localhost` PROCEDURE `retrive_rules`(in username_var varchar(50), in key_var char(20),out query_var varchar(10000))
BEGIN
	declare flag boolean default false;
    declare userid_var int;
    declare keyid_var int;
    declare permission_id_var int;
    select id into userid_var from usertable where username = username_var;
